import React, { useEffect, useState } from 'react';
import Header from './Header';
import Events from './Events';
import Another from './Another';
import Another2 from './Another2';
import './Home.css';


const Home = () => {
  const [events, setEvents] = useState([]);

  // Fetch events from API
  useEffect(() => {
    const fetchEvents = async () => {
      try {
        const response = await fetch('https://jsonplaceholder.typicode.com/posts'); // Replace with your API endpoint
        const data = await response.json();
        // Simulate only using the first few posts
        const formattedData = data.slice(0, 5).map((item) => ({
          id: item.id,
          title: item.title,
          description: item.body,
        }));
        setEvents(formattedData);
      } catch (error) {
        console.error('Error fetching events:', error);
      }
    };

    fetchEvents();
  }, []);

  return (
    <div>
      <Header />
      <div className='home-container'>
        <Events events={events} />
        <div className='home-another-container'>
          <Another />
          <Another2 />
        </div>
      </div>
    </div>
  );
};

export default Home;
